import React from 'react';
import { Link } from 'react-router-dom';

import EgovSignupContent from 'pages/login/EgovSignupContent';

import URL from 'constants/url';

function EgovSingup(props) {
    console.group("EgovSignup");
    console.log("[Start] EgovSignup ------------------------------");
    console.log("EgovSignup [props] : ", props);

    const onChangeSignup = (user) => {
        props.onChangeSignup(user);
    }

    console.log("------------------------------EgovSignup [End]");
    console.groupEnd("EgovSignup");

    return (
        <div className="container">
            <div className="c_wrap">
                {/* <!-- Location --> */}
                <div className="location">
                    <ul>
                        <li><Link to={URL.MAIN} className="home" >Home</Link></li>
                        <li>회원가입</li>
                    </ul>
                </div>
                {/* <!--// Location --> */}

                <div className="layout">
                    <EgovSignupContent
                        onChangeSignup={onChangeSignup}
                    ></EgovSignupContent>
                </div>
            </div>
        </div>
    );
}

export default EgovSignup;
